export default class MusicParallax extends React.Component {

    render() {
        return (

            <ParallaxLayer
                offset={0}>

                <div>

                    <Parallax
                        className='MusicParallax'
                        ref={ref => (this.MusicParallax = ref)}
                        pages={1.5}
                        style={{ 'height': '70vh', 'width': '100%' }}>

                        <div className='Pictures'>

                            <ParallaxLayer
                                speed={.5}
                                offset={.999}>

                                <div className='Info'>
                                    <p>Photography is one of my favorite ways to feel free. I love taking pictures of the city.</p>
                                </div>

                                <div className='Back'>
                                    <button onClick={() => this.MusicParallax.scrollTo(0)} >⬆︎</button>
                                </div>

                            </ParallaxLayer>

                            <ParallaxLayer
                                speed={1}
                                offset={0}>

                                <div className='Container one'>
                                    <img src={Music1} alt = 'Music1' className='Image' />
                                </div>

                            </ParallaxLayer>

                            <ParallaxLayer
                                speed={1.5}
                                offset={0}>

                                <div className='Container two'>
                                    <img src={Music2} alt = 'Music2' className='Image' />
                                </div>

                            </ParallaxLayer>

                            <ParallaxLayer
                                speed={2}
                                offset={0}>

                                <div className='Container three'>
                                    <img src={Music3} alt = 'Music3' className='Image' />
                                </div>

                            </ParallaxLayer>

                            <ParallaxLayer
                                speed={1}
                                offset={0.03}>

                                <div className='Topic'>
                                    <h1>Photography</h1>
                                    <button onClick={() => this.MusicParallax.scrollTo(1.5)}>⬇︎</button>
                                </div>

                            </ParallaxLayer>

                        </div>

                    </Parallax>

                </div>

            </ParallaxLayer>


        )
    }

